import { useContext } from "react";
import TaskContext from "../../store/task-list";
import styleContainer from "./styles/TaskList.module.css";
import TaskListElement from "./TaskListElement";

const TaskList = () => {
  const { data, changeStatus, openModalEditView} = useContext(TaskContext);
    

  let variable = data.map((ctx) => <TaskListElement key={ctx.id} ctx = {ctx} changeStatus={changeStatus} />);

  return <div className={styleContainer.container}>{variable}</div>;
};

export default TaskList;
